  body {
    font-size: 18px;
  }
  .row {
    width: 1600px;
  }
  .section-3 .wrapper {
    width: 1570px;
  }
  .section-3 .wrapper .gallery-translate {
    margin-left: -420px;
  }
  footer .col-6:last-child .tick {
    bottom: -2.5em;
    right: -3em;
  }
}

